function sortTable(f,n){
    var rows = $('#mytable tbody tr').get();
    
    rows.sort(function(a, b) {
        var A = getVal(a);
        var B = getVal(b);
       
        if(A < B) {
            return -1*f;
        }
        if(A > B) {
            return 1*f;
        }
        return 0;
    });
    function getVal(elm){
        var element = $(elm).children('td').get(n);



var v = element.innerHTML.replace(/(<[a-zA-Z ]+[=\"\' ]+[a-zA-Z0-9]+[\"\' ]+)/ig,"")
 if ($(elm).children('td').children('input').length  > 0) { 
        var v = $("input",element).val(); console.log(v )
            } 




        if($.isNumeric(v)){
            v = parseInt(v,10);
        }


        
        return v;
    }
    $.each(rows, function(index, row) {
        $('#mytable').children('tbody').append(row);
    });
}
